const Milestone = ({ label, isStatusCompleted }) => {
    return (
        <div className="flex gap-3">
            <div className="w-4 h-4 bg-white w-3 rounded-full flex justify-center items-center">
                <div
                    className={`w-2 h-2 rounded-full ${
                        isStatusCompleted ? "bg-white" : "bg-red"
                    }`}
                ></div>
            </div>
            <p className="font-poppins font-md text-white">{label}</p>
        </div>
    );
};

export { Milestone };
